descr:
Notifico que a empresa supracitada epresentou os documentos abaixo:
- Alvará sanitário do veículo que irá transportar (placa: MMD5A47);
- Certificado de calibração do equipamento utilizado no monitoramento de temperatura;
- Documentação da farmacêutica que avaliou o monitoramento.
Portanto os medicamentos apreendidos conforme o auto  do apreensão n. 115257 do dia 16/04/2025 podem ser retirados para os locais indicados nas notas fiscais
